%[text] # **Radar Scope Examples**
%[text] **Overview**
%[text] The `RadarScope` is a component for displaying a variable number of [`Blip`](<matlab: edit("Blip")>) objects on a scope. Blip objects can be added and removed from the scope. The scope tracks the pairwise proximity of the blips and notifies an event (`NearbyBlipsDetected`) if two blips are close.
%[text] ![RadarScope.png](text:image:77c7)
%[text] **Documentation**
%[text] - [`polaraxes`](<matlab: doc("polaraxes")>): Create polar axes
%[text] - [`polarplot`](<matlab: doc("polarplot")>): Plot line in polar coordinates
%[text] - [`text`](<matlab: doc("text")>): Add text descriptions to data points
%[text] - [`uilabel`](<matlab: doc("uilabel")>): Create label component
%[text] - [`uilamp`](<matlab: doc("uilamp")>): Create lamp component
%[text] - [`pdist`](<matlab: doc("pdist")>): Pairwise distance between pairs of observations \
%%
%[text] ## **Import the blip data.**
blipFile = fullfile( chartsRoot(), "data", "Blips.csv" );
blipData = readtable( blipFile, "TextType", "string" );
disp( blipData ) %[output:37545ebb]
%%
%[text] ## Create a figure for the radar scope.
f = exampleFigure( "Name", "RadarScope Example" ); %[output:2838991c]
%%
%[text] ## Create the radar scope.
RS = RadarScope( "Parent", f ); %[output:2838991c]
%%
%[text] ## Create an array of blips and add them to the scope.
for k = height( blipData ) : -1 : 1 %[output:group:5ee078a5]
    B(k, 1) = Blip( "Position", [blipData.Theta(k), blipData.Rho(k)], ...
        "String", blipData.Tag(k) );
    RS.addBlip( B(k, 1) ) %[output:7ff8505a]
end % for %[output:group:5ee078a5]
%%
%[text] ## Set a callback function to respond to nearby blips being detected.
RS.NearbyBlipsDetectedFcn = @( s, e ) disp( "Proximity alert!" );
%%
%[text] ## Move one of the blips.
theta = linspace( 0, 2 * pi ).';
for k = 1 : numel( theta ) %[output:group:71b57564]
    B(1).Position(1) = theta(k); %[output:1274d6c5] %[output:27356cfb]
    pause( 0.1 )
end % for %[output:group:71b57564]
